// [TextFinder] textfinder.pro
//void TextFinder::on_findButton_clicked()
void notepadq::on_findButton_clicked(QString sd)
{
    QString searchString = sd;
    QTextDocument *document = ui->textEdit->document();

    bool found = false;
    int blockNumber ;
    int blockCount = 0;
      QString blockNumbers;
    // undo previous change (if any)
    document->undo();

    if (searchString.isEmpty()) {  //if (1)
        QMessageBox::information(this, tr("Empty Search Field"),
                                 tr("The search field is empty. "
                                    "Please enter a word and click Find."));
    } else {
        QTextCursor highlightCursor(document);
        QTextCursor cursor(document);

        cursor.beginEditBlock();
//! [6]

        QTextCharFormat plainFormat(highlightCursor.charFormat());
        QTextCharFormat colorFormat = plainFormat;
        colorFormat.setForeground(Qt::red);

        while (!highlightCursor.isNull() && !highlightCursor.atEnd()) {
            highlightCursor = document->find(searchString, highlightCursor,
                                             QTextDocument::FindWholeWords);

            if (!highlightCursor.isNull()) {  // if (2)
                found = true;
                highlightCursor.movePosition(QTextCursor::WordRight,
                                             QTextCursor::KeepAnchor);
                highlightCursor.mergeCharFormat(colorFormat);
                blockNumber = highlightCursor.blockNumber();
                blockNumbers += QString::number(blockNumber) + ",";
                blockCount++;

            }//EDN if(2)
        }//EDN while

//! [8]
        cursor.endEditBlock();
        if(blockNumbers >= 1 && blockNumbers.back() == ",") {
            blockNumbers.chop(1);
        }
         mSend("Find Count : "+ QString::number(blockCount) + "\n Find lines : "+blockNumbers );
//! [7] //! [9]

        if (found == false) {// if (4)
            QMessageBox::information(this, tr("Word Not Found"),
                                     tr("Sorry, the word cannot be found."));
        }//EDN if(4)
    }//EDN if(1)
}
